import React, { useRef } from 'react';
import useGoogleMap from '../../hooks/useGoogleMap';

const MapView = () => {
  const mapRef = useRef(null);
  useGoogleMap(mapRef);

  return (
    <>
      <div 
        style={{ width: '20%', height: '20vh' }}
      />

      <div
        ref={mapRef}
        style={{ width: '100%', height: '95vh' }}
      />
    </>

  );
};

export default MapView;
